package CollectionInJava;

import java.util.TreeSet;
public class TreeSetInJava {

	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		TreeSet ts= new TreeSet<>();
		ts.add("c");
		ts.add("xyz");
		ts.add("pqr");
		ts.add("hema");
		ts.add("abc");
		ts.add("tom");
		System.out.print(ts.descendingSet());

		
	}

}




